import React from "react";

const Navbar = () => {
    return (
        <div className="navbar">
            <nav>
                <a href="#">About</a>
                <a href="#">Works</a>
                <a href="#">Partners</a>
                <a href="#">Price</a>
                <a href="#">Contacts</a>
            </nav>
        </div>
    )
}

export default Navbar
